import React from 'react';
import { useNavigate } from 'react-router-dom';

const HomePage = () => {
  const navigate = useNavigate();

  return (
    <div style={{
      margin: 0,
      padding: 0,
      boxSizing: 'border-box',
      fontFamily: 'Arial, sans-serif',
      background: '#2c3e50',
      color: 'white',
      minHeight: '100vh'
    }}>
      <header style={{
        display: 'flex',
        justifyContent: 'space-between',
        alignItems: 'center',
        padding: '20px 50px',
        background: 'rgba(0,0,0,0.2)'
      }}>
        <div style={{
          fontSize: '24px',
          fontWeight: 'bold'
        }}>CMS</div>

        <div style={{
          display: 'flex',
          gap: '15px'
        }}>
          <a 
            href="/faq"
            style={{
              padding: '10px 25px',
              textDecoration: 'none',
              borderRadius: '5px',
              fontSize: '16px',
              transition: '0.3s',
              background: 'transparent',
              color: 'white',
              border: '2px solid white',
              marginRight: '10px'
            }}
            onMouseEnter={(e) => {
              e.target.style.background = 'white';
              e.target.style.color = '#2c3e50';
            }}
            onMouseLeave={(e) => {
              e.target.style.background = 'transparent';
              e.target.style.color = 'white';
            }}
          >FAQ</a>

          <a 
            href="/login"
            style={{
              padding: '10px 25px',
              textDecoration: 'none',
              borderRadius: '5px',
              fontSize: '16px',
              transition: '0.3s',
              background: 'transparent',
              color: 'white',
              border: '2px solid white'
            }}
            onMouseEnter={(e) => {
              e.target.style.background = 'white';
              e.target.style.color = '#2c3e50';
            }}
            onMouseLeave={(e) => {
              e.target.style.background = 'transparent';
              e.target.style.color = 'white';
            }}
          >Login</a>

          <a 
            href="/signin"
            style={{
              padding: '10px 25px',
              textDecoration: 'none',
              borderRadius: '5px',
              fontSize: '16px',
              transition: '0.3s',
              background: 'white',
              color: '#2c3e50'
            }}
            onMouseEnter={(e) => {
              e.target.style.background = '#ecf0f1';
            }}
            onMouseLeave={(e) => {
              e.target.style.background = 'white';
            }}
          >Sign In</a>
        </div>
      </header>

      <div style={{
        textAlign: 'center',
        padding: '100px 20px'
      }}>
        <h1 style={{
          fontSize: '48px',
          marginBottom: '20px'
        }}>Complaint Management System</h1>

        <p style={{
          fontSize: '20px',
          color: '#ecf0f1'
        }}>Efficiently manage and track all your complaints in one place</p>
      </div>
    </div>
  );
};

export default HomePage;
